import React from 'react';
import "../Logs/Datt.css";

const Datt =() =>{

    return(

        <div>
        <div className='item'>
        <div className='date'>
        <div className='month'>月份</div>
        <div className='day'>20</div>
        </div>
        </div>
        </div>
    );
};

export default Datt;
